import React from "react";

export default function Certifications() {
  return (
    <section className="mb-10">
      <h2 className="text-2xl font-semibold border-b pb-2">Certifications</h2>
      <ul className="list-disc list-inside mt-2">
        <li>Automation Developer Associate (UiPath)</li>
        <li>React.js Crash Course – Udemy</li>
        <li>Intro to Industry 4.0 and IoT – NPTEL</li>
        <li>Intro to Machine Learning – Great Learning</li>
      </ul>
    </section>
  );
}
